import React from "react";
import './Modal.css'
import {FaTimes} from "react-icons/fa";

function Modal ({closeModel}) {
    return(
        <>
            <div className='bg' onClick={() => closeModel(false)}>
                <div className='modalContainer'>
                    <FaTimes className="fa-times" style={"align: right"} onClick={() => closeModel(false)} />
                    <div className='body'>
                        <h1>expander</h1>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Modal;
